import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
// import "./src/celebrity.js";

const celebrity = [{
  name: "Selena Gomez",
  image: "https://i.pinimg.com/564x/cf/6f/be/cf6fbecd137719bf6d5854b1c0be53d9.jpg",
  tel: "+972 52-788-3564",
  email: "selena@email.com"
}, {
  name: "Miley Cyrus",
  image: "https://i.pinimg.com/564x/40/24/4a/40244a1bc39966180137c130bf785334.jpg",
  tel: "+972 52-635-9937",
  email: "miley@email.com"
}, {
  name: "Emma Watson",
  image: "https://i.pinimg.com/564x/64/95/d0/6495d05033eb2029300f4a6fe5151952.jpg",
  tel: "+972 52-726-1126",
  email: "emma@email.com"
}];


function appContent() {

  return ( < div > < Header / > < body > < h1 className = "heading" > My Contacts < /h1> <
    Note name = {
      celebrity[0].name
    }
    image = {
      celebrity[0].image
    }
    tel = {
      celebrity[0].tel
    }
    email = {
      celebrity[0].email
    }
    / > <
    Note name = {
      celebrity[1].name
    }
    image = {
      celebrity[1].image
    }
    tel = {
      celebrity[1].tel
    }
    email = {
      celebrity[1].email
    }
    / > <
    Note name = {
      celebrity[2].name
    }
    image = {
      celebrity[2].image
    }
    tel = {
      celebrity[2].tel
    }
    email = {
      celebrity[2].email
    }
    / ></body > <
    Footer / > < /div>);
  }

  export default appContent;
